sys_variable_value.value:
(function execute(inputs, outputs) {
var gr = new GlideAggregate('x_snc_tbx_config_adm_ref_params');
gr.groupBy('o_site'); //Group aggregate by the 'os' field
gr.query();  

var str="";  

while(gr.next()){

str = str +" "+gr.o_site;

}

outputs.sites=str;  

})(inputs, outputs);

